import styled from "styled-components";
import Menu from "../assets/icons/menu";

const HeaderBar = styled.div`
  height: 50px;
  box-sizing: border-box;
  display: flex;
  padding: 11px 12px;
  background: #fff;
  position: sticky;
  top: 0;
  z-index: 1000;
  border-bottom: 2px solid #e4e4e4;

  font-family: Rubik;
  font-style: normal;
  font-size: 16px;
  line-height: 20px;
  color: #ffffff;

  .menu {
    cursor: pointer;
  }
`;

function App() {
  return (
    <>
      <HeaderBar>
        <Menu width="25" height="25" className="menu" />
      </HeaderBar>
    </>
  );
}

export default App;
